import styled from "styled-components";

export const Container = styled.header`
  display: flex;
  width: 100vw;
  padding: 0;
  margin: 0;
  align-items: center;
  background-color: var(--main-background-color);
`;

export const ContentContainer = styled.div`


  .summary-container {
    width: 100vw;
    color: var(--gray-background-color);
  }
`;
